import React from 'react';
import { useState, useEffect, useRef } from 'react';

import Button from '@mui/material/Button';
import axios from 'axios';

function Test_one() {
    axios.get("")
  .then((response) => {
    console.log(response)
  })
  .catch((error) => {
    console.log(error)
  })
}

export default Test_one;
